import React from 'react';
import './App.css';
import { 
    AppBar, Button
} from '@material-ui/core';
import ChildCareIcon from '@material-ui/icons/ChildCare';
import Container from '@material-ui/core/Container';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import { Link as MaterialLink } from '@material-ui/core/Link';
import { Link as RouterLink } from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import SvgIcon from '@material-ui/core/SvgIcon';
import Upload from './Layouts/Upload.js'
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
  '@global': {
    body: {
      backgroundColor: theme.palette.common.white,
    },
    ul: {
      margin: 0,
      padding: 0,
    },
    li: {
      listStyle: 'none',
    },
  },
  appBar: {
    borderBottom: `1px solid ${theme.palette.divider}`,
  },
  toolbar: {
    flexWrap: 'wrap',
  },
  toolbarTitle: {
    flexGrow: 1,
  },
  materialLink: {
    margin: theme.spacing(1, 1.5),
  },

  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(25, 0, 6),
  },
}));

const Link = React.forwardRef((props, ref) => <RouterLink innerRef={ref} {...props} />);

export default function App() {
  const classes = useStyles();

  return (
    <React.Fragment>

      <CssBaseline />

      <AppBar position="static" color="default" elevation={0} className={classes.appBar}>
        <Toolbar className={classes.toolbar}>
          <ChildCareIcon fontSize="large" />
          <Typography variant="h6" color="inherit" noWrap className={classes.toolbarTitle}>
            Happy Walrus
          </Typography>
          <nav>
            <MaterialLink variant="button" color="textPrimary" href="#" className={classes.materialLink}>
              Learn More
            </MaterialLink>
            <MaterialLink variant="button" color="textPrimary" href="#" className={classes.materialLink}>
              About Us
            </MaterialLink>
          </nav>
          <Button href="#" color="primary" variant="outlined" className={classes.materialLink}>
            Sign Up
          </Button>
          <Button href="#" color="secondary" variant="outlined" className={classes.materialLink}>
            Login
          </Button>
        </Toolbar>
      </AppBar>

      <main>
        {/* Hero unit */}
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" align="center" variant="h2" color="textPrimary" gutterBottom>
              Header 1
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
              Something short and leading about the application.
            </Typography>
            <div className={classes.heroButtons}>
              <Grid container justify="center">
                <Grid item>
                  <Button component={ Link } to="/" variant="contained" color="primary">
                    Get Started
                  </Button>
                </Grid>
              </Grid>
            </div>
          </Container>
          </div>
      </main>

    </React.Fragment>

  );
}
